import React, { useRef } from 'react';
import SoftPhone from 'react-softphone';
import { UA, WebSocketInterface } from 'jssip';

const config = {
    uri: 'sip:200-dataocean@webrtc.1com.co.il',
    password: 'RjH2TV2s9s8FHSpz',
    ws_servers: 'wss://webrtc.1com.co.il/ws',
    sockets: new WebSocketInterface('wss://webrtc.1com.co.il/ws'),
    display_name: 'My Display Name',
    debug: false,
};

function Phone(props) {
    const uaRef = useRef(null);

    const makeCall = () => {
        const destination = prompt('Enter the destination SIP URI:');
        if (destination) {
            const session = uaRef.current.call(destination, {
                mediaConstraints: { audio: true, video: false },
            });
            console.log('Calling', destination);
            session.on('ended', () => {
                console.log('Call ended');
            });
            session.on('failed', () => {
                console.log('Call failed');
            });
        }
    };

    return (
        <div>
            <button onClick={makeCall}>Make Call</button>
            <SoftPhone
                config={config}
                uaRef={uaRef}
            />
        </div>
    );
}

export default Phone;
